import React from 'react'

class Main extends React.Component{

    render(){
        return (
            <React.Fragment>
            <Header></Header>
            <Sidebar></Sidebar> 
            <Section1></Section1>
            <Section2></Section2> 
            <Section3></Section3>
            <Footer></Footer>      
            </React.Fragment>
        )        
    }

}

export default Main
